INSERT INTO `news` VALUES (1, 1, 1, 1, '2022-12-19 23:22:21', '习近平同科特迪瓦总统瓦塔拉通电话', '新华社北京12月20日电 国家主席习近平20日下午应约同科特迪瓦总统瓦塔拉通电话。\r\n\r\n　　习近平指出，科特迪瓦是中国在非洲的重要合作伙伴。明年是中科建交40周年，值得双方共同纪念。中方高度赞赏科方坚定恪守一个中国原则，愿同科方继续在涉及彼此核心利益问题上相互支持，巩固和深化中科关系，推动两国关系迈上新台阶。\r\n\r\n　　习近平指出，中科合作具有广阔前景。中方愿同科方加强全方位合作，扩大农产品贸易，加强水稻、可可等种植和加工合作，支持科做大做强可可产业，希望中方支持承建的有关项目尽快建成并发挥效益。中方愿继续鼓励中国企业赴科投资兴业，拓展双方在数字经济、新能源等领域合作。中方赞赏科方发展和安全并重的执政理念，愿同科方加强政策交流，根据科方需求开展合作并提供力所能及的支持。中方始终秉持真实亲诚理念和正确义利观加强同非洲国家团结合作，愿继续以实际行动落实全球发展倡议和中非合作论坛行动计划，助力非洲发展。中方愿同科特迪瓦等非洲国家一道，维护国际公平正义，维护发展中国家共同利益。\r\n\r\n　　瓦塔拉表示，再次祝贺习近平主席当选中共中央总书记。我对2018年对中国的国事访问留下深刻印象，对科中即将迎来建交40周年充满期待。中方为维护和促进包括科特迪瓦在内的地区和世界和平与安全、支持非洲国家经济社会发展提供了宝贵支持、作出了重要贡献，科方表示衷心感谢。科方对中国人民怀有美好情谊。科方坚定恪守一个中国原则，坚定支持多边主义，积极支持“一带一路”倡议。欢迎更多中国企业来科投资可可加工等产业，助力科工业化进程。科方愿同中方继续加强在中非合作论坛框架内合作，就地区和国际事务保持密切沟通协作。', 1, '', 0);
INSERT INTO `news` VALUES (2, 1, 1, 2, '2022-12-20 23:19:05', '引领——从党的二十大看中国共产党的成功密码之一', '引领，贯穿于党的二十大各项议程，彰显在党的二十大精神之中——\r\n\r\n　　选举产生以习近平同志为核心的新一届党中央，坚强核心引领壮阔征程；把党的十九大以来习近平新时代中国特色社会主义思想新发展写入党章，真理之光引领复兴之路；描绘未来党和国家事业新蓝图，清晰目标指明奋进方向。\r\n\r\n　　这是一种紧密团结在党中央周围的向心力，这是一种科学理论武装起来的战斗力，这是一种为了伟大梦想而不懈奋斗的执行力。中国共产党人团结成一块坚硬的钢铁，用伟大奋斗创造了百年伟业，不断从胜利走向新的胜利。\r\n\r\n　　核心引领：发挥定于一尊的领航作用\r\n\r\n　　2022年10月23日，人民大会堂金色大厅见证历史性时刻。\r\n\r\n　　万众期盼中，刚刚当选新一届中共中央总书记的习近平，带领其他中央政治局常委同中外记者见面，发出奋进新征程的豪迈誓言：\r\n\r\n　　“我代表新一届中共中央领导成员，衷心感谢全党同志的信任。我们一定牢记党的性质和宗旨，牢记自己的使命和责任，恪尽职守、勤勉工作，决不辜负党和人民重托。”\r\n\r\n　　这一刻，新时代领航者的自信、担当，通过直播信号传遍神州大地，全党全国各族人民信心倍增：有以习近平同志为核心的党中央掌舵领航，百年大党必将用新的伟大奋斗创造新的历史伟业。\r\n\r\n　　拥有坚强的领导核心，事关无产阶级政党的生死存亡和社会主义事业的兴衰成败。\r\n\r\n　　这一马克思主义建党学说的重大原则，在中国共产党的百年历程中，一次次被实践所证明。\r\n\r\n　　党的十八大以来，中国特色社会主义进入新时代，党和国家面临的形势之复杂、斗争之严峻、改革发展稳定任务之艰巨世所罕见、史所罕见。\r\n\r\n　　勇担重任，举全国之力打赢脱贫攻坚战，胜利实现全面建成小康社会目标；着眼长远，坚定不移推进高质量发展，推动中国经济行稳致远；应对挑战，采取最科学、最经济的办法，统筹疫情防控和经济社会发展取得重大积极成果；敢于斗争，在斗争中维护国家尊严和核心利益，牢牢掌握了国家发展和安全主动权；自我革命，反腐败斗争取得压倒性胜利并全面巩固……\r\n\r\n　　在关乎党和国家事业兴衰成败的重要时刻，习近平总书记带领全党全军全国各族人民披荆斩棘，建立非凡之功，开创崭新局面。\r\n\r\n　　放眼新时代中华大地，以习近平同志为核心的党中央坐镇中军帐、全党上下“如身使臂，如臂使指”，车马炮各展其长、一盘棋大局分明的生动画卷徐徐铺展。\r\n\r\n　　当实现中华民族伟大复兴进入关键时期，诸多“拦路虎”“绊脚石”出现在前进路上，一系列“最复杂”“最敏感”问题相互交织。我们这样一个有着14亿多人口的大国、有着9600多万党员的大党，更加需要核心的引领。\r\n\r\n　　这是全党的意志，这是人民的选择。\r\n\r\n　　思想引领：掌握改变中国的真理力量\r\n\r\n　　2022年10月27日，延安杨家岭秋意正浓。\r\n\r\n　　党的二十大后首次地方考察，习近平总书记来到中共七大会址，从历史深处探寻中国共产党的制胜密码。\r\n\r\n　　确立毛泽东思想在全党的指导地位，把毛泽东思想写入了党章……党的七大在党史上具有极其重要的地位，为党后来不断从胜利走向胜利指明了正确方向、开辟了正确道路。\r\n\r\n　　在党的二十大闭幕会上，出席党的二十大的代表庄严表决，大会一致同意把党的十九大以来习近平新时代中国特色社会主义思想新发展写入党章。\r\n\r\n　　一个理想崇高、志向远大的党，一旦掌握了科学的思想，就能够历经磨难而无往不胜。\r\n\r\n　　翻开风雷激荡的百年史册，坚持马克思列宁主义、毛泽东思想、邓小平理论、“三个代表”重要思想、科学发展观，全面贯彻习近平新时代中国特色社会主义思想，中国共产党既坚定地信仰马克思主义，又以科学的态度对待马克思主义。\r\n\r\n　　正如党的二十大报告中所指出的：实践告诉我们，中国共产党为什么能，中国特色社会主义为什么好，归根到底是马克思主义行，是中国化时代化的马克思主义行。\r\n\r\n　　党的十八大以来，新时代中国共产党人赋予马克思主义以鲜明的中国特色、民族特色、时代特色，对共产党执政规律、社会主义建设规律、人类社会发展规律的认识达到了一个新的历史高度，集中体现为习近平新时代中国特色社会主义思想。\r\n\r\n　　以习近平同志为核心的党中央立足时代之基、回答时代之问、引领时代之变，以高远的视野、深邃的思考，写下了在中国特色社会主义道路上实现中华民族伟大复兴的新篇章——\r\n\r\n　　以“四个自信”凝聚团结奋斗伟力，以“五位一体”坚持和完善中国特色社会主义事业布局，以“四个全面”协调推进战略布局，以“中国式现代化”全面推进中华民族伟大复兴，以“推动构建人类命运共同体”的宏阔视野观照人类前途命运……\r\n\r\n　　置身百年风云中擘画中华民族复兴大业，站在世界版图前思考人类命运走向，习近平新时代中国特色社会主义思想展现出强大的时空贯通力、现实解释力、实践改造力。\r\n\r\n　　目标引领：指明矢志不渝的奋斗方向\r\n\r\n　　时间回到10年前——\r\n\r\n　　2012年11月29日，在国家博物馆参观《复兴之路》展览时，习近平总书记抚今追昔、话语坚定：“我以为，实现中华民族伟大复兴，就是中华民族近代以来最伟大的梦想。”\r\n\r\n　　伟大的目标，激起亿万人民的磅礴力量。\r\n\r\n　　恩格斯曾说：“一个知道自己的目的，也知道怎样达到这个目的的政党，一个真正想达到这个目的并且具有达到这个目的所必不可缺的顽强精神的政党——这样的政党将是不可战胜的。”\r\n\r\n　　以宏阔目标校准航向、凝聚力量，中国共产党人的目光总是深远而坚定。\r\n\r\n　　民族危亡之际，党的二大确立“达到中华民族完全独立”的纲领，成为探索救亡之路的旗帜；新中国成立之初，“善于建设一个新世界”的目标，点燃激情昂扬的岁月；改革春潮涌动之时，建设小康社会的追求，唤醒亿万人民创造幸福生活的动力；中国特色社会主义进入新时代，现代化强国蓝图，凝聚起“撸起袖子加油干”的磅礴力量……\r\n\r\n　　既胸怀远大理想，更善于埋头苦干。\r\n\r\n　　百年复兴路上，中国共产党人将宏大愿景同阶段性目标相结合，一步步推进，一桩桩实现。\r\n\r\n　　改革开放后，我们党提出社会主义现代化建设“三步走”战略目标。\r\n\r\n　　党的十九大把握历史新方位、顺应时代新特点，作出“分两步走”全面建成社会主义现代化强国的新的战略安排。', 1, '', 0);
INSERT INTO `news` VALUES (3, 1, 1, 2, '2022-12-20 23:32:11', '第一观察｜中央经济工作会议提出“六个更好统筹”', '2023年是全面贯彻落实党的二十大精神的开局之年，也是疫情防控进入新阶段的重要一年，做好经济工作意义重大。明年经济发展面临诸多困难挑战，刚刚结束的中央经济工作会议强调要坚持系统观念、守正创新，并提出“六个更好统筹”——\r\n\r\n　　“更好统筹疫情防控和经济社会发展”\r\n\r\n　　此次会议将“更好统筹疫情防控和经济社会发展”摆在首位，凸显重要意义。\r\n\r\n　　“疫情要防住、经济要稳住、发展要安全，这是党中央的明确要求。”\r\n\r\n　　疫情暴发以来，我们有效应对疫情冲击，人民生命安全和身体健康得到有效守护。过去三年我国经济年均增长4.5%左右，明显高于世界平均水平。抗疫和发展的成绩有目共睹，经得起历史的检验。\r\n\r\n　　新阶段要解决好新问题。当前，病毒传染性强，但重症率、致死率显著降低，疫情防控主要矛盾发生了变化。按照中央部署实施好优化疫情防控各项措施，将加快经济秩序和社会秩序的恢复，进一步促进经济循环起来、运转起来。\r\n\r\n　　“更好统筹经济质的有效提升和量的合理增长”\r\n\r\n　　经济发展是量变和质变的有机统一。\r\n\r\n　　在如何看待“质”和“量”的关系方面，会议将“质”放在“量”的前面，凸显经济发展“质”的重要性，也意味着高质量发展是未来我国经济工作的不变主题。\r\n\r\n　　推动经济高质量发展，也要继续实现“量”的合理增长。当前我国经济发展仍需保持合理的增长速度，只有把经济发展的蛋糕做大，才能在当前形势下保持经济平稳运行，维护社会大局稳定。\r\n\r\n　　“更好统筹供给侧结构性改革和扩大内需”\r\n\r\n　　深化供给侧结构性改革是实现高质量发展的必由之路，是贯穿经济工作全过程的主线。同时，必须大力实施扩大内需战略，应对当前总需求不足的突出矛盾。\r\n\r\n　　当前经济工作中的很多领域都是供给侧结构性改革和扩大内需的结合点。因此，要创造有利的体制机制环境，采取适当的政策引导，使这些结合点变成经济的增长点，推动中国经济沿着高质量发展道路稳定向前。\r\n\r\n　　“更好统筹经济政策和其他政策”\r\n\r\n　　经济社会发展是一个相互关联的复杂系统，涵盖社会建设、民生保障、生态环保、文化建设等方方面面。对各方面政策进行统筹，相互支撑、促进，才能形成高质量发展的合力。\r\n\r\n　　党的二十大精神和党中央关于经济工作的决策部署是推动我国经济社会稳定发展的关键引领。制定和实施政策，都要服务于推动高质量发展这个主题，坚持系统观念和实践标准，遵循经济规律，以实践效果检验政策的成败优劣。要加强与宏观政策取向一致性评估，及时发现和调整政策执行的偏差，清理和废止有悖于高质量发展的政策文件，促进形成推动高质量发展的合力。\r\n\r\n　　“更好统筹国内循环和国际循环”\r\n\r\n　　加快构建以国内大循环为主体、国内国际双循环相互促进的新发展格局，就是要更多依靠国内市场实现经济发展，进而塑造我国参与国际合作和竞争新优势。\r\n\r\n　　新发展格局决不是封闭的国内循环，而是开放的国内国际双循环。当前，我国贸易、投资、人才、技术等方面的国际循环，都需要进一步扩大规模、优化结构、提高质量。以国际循环提升国内大循环效率和水平，改善我国生产要素质量和配置水平，形成国内国际双循环相互促进的良性互动关系。\r\n\r\n　　“更好统筹当前和长远”\r\n\r\n　　习近平总书记在党的二十大报告中指出：“从现在起，中国共产党的中心任务就是团结带领全国各族人民全面建成社会主义现代化强国、实现第二个百年奋斗目标，以中国式现代化全面推进中华民族伟大复兴。”\r\n\r\n　　中国式现代化是一个长期的历史过程。全面贯彻落实党的二十大精神的开局之年，我们既要立足当前，做好眼下的工作，又要有前瞻性的思考，准确把握客观实际，统筹考虑短期应对和中长期发展，为今后的发展做好衔接。\r\n\r\n　　疫情防控和经济社会发展、质与量、供与需、局部和全局、国内和国际、当前和长远——“六个更好统筹”，是系统观念在宏观调控中的具体运用，坚持从系统论出发优化经济治理方式，既考虑了明年经济工作的年度特征，也是近年来我国经济工作的重要经验。\r\n\r\n　　坚持系统观念是习近平经济思想重要的方法论。在领导各项工作时，我们党始终注重综合平衡、总体谋划。面对实际工作的复杂形势和繁重任务，既聚焦统筹兼顾，又注重抓住重点，做好逆周期和跨周期宏观调控，“十个指头弹钢琴”，在多重目标中寻求动态平衡。\r\n\r\n　　承压前行，爬坡过坎。做好明年经济工作，必须做好“六个更好统筹”。加强党对经济工作的全面领导，坚持真抓实干，以奋发有为的精神状态和“时时放心不下”的责任意识做好经济工作，激发全社会干事创业活力，我们一定能实现“开门稳”，为全面建设社会主义现代化国家开好局起好步。', 2, '', 100);
INSERT INTO `news` VALUES (4, 1, 1, 2, '2022-12-20 23:33:03', '国务院关于同意在沈阳等6个城市\r\n\r\n开展服务业扩大开放综合试点的批复', '辽宁省、江苏省、浙江省、湖北省、广东省、四川省人民政府，商务部：\r\n\r\n你们关于开展服务业扩大开放综合试点的请示收悉。现批复如下：\r\n\r\n一、同意在沈阳市、南京市、杭州市、武汉市、广州市、成都市（以下称六城市）开展服务业扩大开放综合试点，试点期为自批复之日起3年。原则同意六城市服务业扩大开放综合试点总体方案，请认真组织实施。\r\n\r\n二、试点要以习近平新时代中国特色社会主义思想为指导，深入贯彻党的二十大精神，统筹推进“五位一体”总体布局，协调推进“四个全面”战略布局，按照党中央、国务院决策部署，完整、准确、全面贯彻新发展理念，稳步扩大规则、规制、管理、标准等制度型开放，紧紧围绕本地区发展定位，进一步推进服务业改革开放，加快发展现代服务业，塑造国际竞争和合作新优势，为加快构建新发展格局、推动高质量发展作出贡献。\r\n\r\n三、有关省级人民政府要加强对服务业扩大开放综合试点工作的组织领导，在风险可控的前提下，精心组织，大胆实践，服务国家重大战略，开展差异化探索，在加快发展现代产业体系、推进高水平对外开放等方面取得更多可复制可推广的经验，为全国服务业的开放发展、创新发展发挥示范带动作用。\r\n\r\n四、国务院有关部门要按照职责分工，积极支持六城市开展服务业扩大开放综合试点。商务部要会同有关部门加强指导和协调推进，组织开展成效评估，确保各项改革开放措施落实到位。\r\n\r\n五、需要暂时调整实施相关行政法规、国务院文件和经国务院批准的部门规章的部分规定的，按规定程序办理。国务院有关部门相应调整本部门制定的规章和规范性文件。试点中的重大问题，有关省级人民政府和商务部要及时向国务院请示报告。', 3, '再改改', 0);
INSERT INTO `news` VALUES (5, 2, 1, 2, '2022-12-20 23:36:11', '建设品质文化，助力质量强国：伊利荣获全国企业文化优秀成果特等奖', '以品质文化引领企业发展 建设质量强国彰显龙头担当\r\n\r\n  多年来，伊利将助力质量强国的事业，融入进守护国民“舌尖上的安全”、促进国民健康的行动中。在伊利集团董事长兼总裁潘刚的推动下，伊利将品质作为发展的重要战略，树立了“伊利即品质”的企业信条，视品质如生命，形成了以坚守品质信条为核心的特色品质文化。', 2, NULL, 100);
